import { Component } from "react";
import styled from "styled-components";

const HomeContainer = styled.div`
  background-color: #a0a0a0;
  height: 100%;
`;

const IntroSectionContainer = styled.div`
  background-color: #ffdc60;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const IntroSectionLayout = styled.div`
  width: 90%;
  display: flex;
  flex-direction: row;
`;

const IntroImageContainer = styled.div`
  width: 50%;
`;

const IntroImage = styled.img`
  width: 50%;
`;

const IntroTextContainer = styled.div`
  width: 50%;
`;

const TempleCount = styled.span``;

const IntroText = styled.p`
  color: #a4213c;
  font-size: ;
`;

const AddTempleBtn = styled.button``;

class Home extends Component {
  render() {
    return (
      <HomeContainer>
        <IntroSectionContainer>
          <IntroSectionLayout>
            <IntroImageContainer>
              <IntroImage
                src="https://templesofindia.org/assets/images/NewHomeTemple.png"
                alt="temple image"
              />
            </IntroImageContainer>
            <IntroTextContainer>
              <IntroText>7,50,000 Plus Temples and Counting...</IntroText>
            </IntroTextContainer>
          </IntroSectionLayout>
        </IntroSectionContainer>
      </HomeContainer>
    );
  }
}

export default Home;
